import React from "react";
import Footer from "../Componets/footer/Footer";
import Navbar from "../Componets/navbar/Navbar";
import Projects from "../Componets/projects/Projects";

function Project() {
  return (
    <div>
      <Navbar />
      <Projects />
      <Footer />
    </div>
  );
}

export default Project;
